def pivot_table(
    data: DataFrame,
    values: str = None,
    index: List = None,
    columns: List = None,
    aggfunc: Union[str, List[str]] = "mean",
    fill_value = None,
    margins: bool = False,
    dropna: bool = True,
    margins_name: str = "All",
    observed: bool = False
) -> DataFrame:
    index = _convert_by(index)
    columns = _convert_by(columns)

    if isinstance(aggfunc, str):
        aggfunc = [aggfunc]

    keys = index + columns

    values_passed = values is not None
    if values_passed:
        if is_list_like(values):
            values_multi = True
            values = list(values)
        else:
            values_multi = False
            values = [values]

        for i in values:
            if i not in data:
                raise KeyError(i)

    else:
        values = data.columns.tolist()
        for key in keys:
            try:
                values.remove(key)
            except (ValueError, KeyError):
                pass

    grouped = data.groupby(keys, observed=observed)
    agged = grouped.agg({v: func for v in values for func in aggfunc})

    if dropna and isinstance(agged, DataFrame) and not agged.empty:
        agged = agged.dropna()

    table = agged

    # Further processing to handle multi-level indices, dropna, etc.

    return table
